import React from 'react';
import {Link} from 'react-scroll';
import styled from 'styled-components'

const SideNav = styled.div`
    height:100vh;
    position:fixed;
    display:flex;
    display: flex;
    justify-content: center;
    align-items: center;
    margin-left:2em;
    z-index:10;
`

const NavLink = styled(Link)`
    font-size:12px;
    color:var(--p-9);
    text-decoration:none;
    padding:.5em;
    :hover {
        color:red;
    }
`

export default function Sidebar () {
   return (
            <SideNav>
                <NavList>
                    <NavListItem>
                        <NavLink
                                activeClass="active"
                                to="about"
                                spy={true}
                                smooth={true}
                                offset={-70}
                                duration={500}
                            >
                            About
                        </NavLink>
                    </NavListItem>
                    <NavListItem>
                        <NavLink
                            activeClass="active"
                            to="recents"
                            spy={true}
                            smooth={true}
                            offset={-70}
                            duration={500}
                        >
                            Recents
                        </NavLink>
                    </NavListItem>
                </NavList> 
            </SideNav>
    )
}
